import { Table, Layout, Space} from "antd";
import "./App.less";
import React from "react";

const { Header, Footer, Sider, Content } = Layout;

function App() {

  return (
    <div className="App">     
    <Layout style={{}}>
      <Space>
      <Sider width="100" style={{background: 'orange'}}>Sider</Sider>
      <Layout>
        <Space direction="vertical">
        <Header style={{background: 'green'}}>Header4</Header>
        <Content>Content4</Content>
        <Footer style={{background: 'black'}}>Footer4</Footer>
        </Space>
      </Layout>
      <Sider style={{background: 'orange'}}>Sider4</Sider>
      </Space>
    </Layout>  
    </div>
  );
}
export default App;
